class AttributeInjectorProcessor implements Processor {

    static final Relationship REL_SUCCESS = new Relationship.Builder()
        .name("success")
        .description("FlowFiles that were successfully processed")
        .build()

    static final Relationship REL_FAILURE = new Relationship.Builder()
        .name("failure")
        .description("FlowFiles that failed to be processed")
        .build()

    private ComponentLog log

    @Override
    void initialize(ProcessorInitializationContext context) {
        log = context.getLogger()
    }

    @Override
    Set<Relationship> getRelationships() {
        return [REL_SUCCESS, REL_FAILURE] as Set
    }

    @Override
    void onTrigger(ProcessContext context, ProcessSessionFactory sessionFactory) throws ProcessException {
        ProcessSession session = sessionFactory.createSession()
        FlowFile flowFile = session.get()
        if (!flowFile) return

        try {
            // Read the content of the FlowFile
            def attributesMap = [:]
            flowFile = session.write(flowFile, new StreamCallback() {
                @Override
                void process(InputStream inputStream, OutputStream outputStream) throws IOException {
                    // Read the input content
                    String inputContent = inputStream.text
                    // Parse the JSON dictionary
                    def jsonSlurper = new JsonSlurper()
                    def jsonObject = jsonSlurper.parseText(inputContent)

                    // Extract and flatten attributes from 'request.nifi_attributes'
                    if (jsonObject.request?.nifi_attributes) {
                        attributesMap.putAll(flatten(jsonObject.request.nifi_attributes))
                    }

