import org.apache.nifi.components.PropertyDescriptor
import org.apache.nifi.controller.ControllerService
import org.apache.nifi.processor.AbstractProcessor
import org.apache.nifi.processor.ProcessContext
import org.apache.nifi.processor.ProcessSession
import org.apache.nifi.processor.Relationship
import org.apache.nifi.processor.util.StandardValidators

class ScriptedProcessor extends AbstractProcessor {

    // Define a PropertyDescriptor for the Controller Service
    static final PropertyDescriptor SERVICE_PROPERTY = new PropertyDescriptor.Builder()
            .name("Controller Service")
            .description("The Controller Service to use")
            .required(true)
            .identifiesControllerService(ControllerService)
            .addValidator(StandardValidators.NON_EMPTY_VALIDATOR)
            .build()

    // Define a dummy relationship (since we don't output anything)
    static final Relationship REL_SUCCESS = new Relationship.Builder()
            .name("success")
            .description("Successfully processed flow files")
            .build()

    // Define the properties supported by this processor
    @Override
    List<PropertyDescriptor> getSupportedPropertyDescriptors() {
        return [SERVICE_PROPERTY]
    }

    // Define the relationships for the processor (none in this case)
    @Override
    Set<Relationship> getRelationships() {
        return [REL_SUCCESS] as Set
    }

    // This method is called every time the processor is triggered
    @Override
    void onTrigger(final ProcessContext context, final ProcessSession session) {
        // Get the flow file from the session (if it exists)
        FlowFile flowFile = session.get()
        if (!flowFile) {
            return
        }

        // Get the controller service instance from the context
        ControllerService controllerService = context.getProperty(SERVICE_PROPERTY).asControllerService(ControllerService)

        // Log the class name of the controller service for debugging
        getLogger().info("Controller Service Class: ${controllerService.getClass().getName()}")

        // Example: Perform actions using the controller service if needed.
        // This processor outputs nothing, so we simply remove the flow file.
        session.remove(flowFile)

        // End of onTrigger, no output flow files
    }
}

// Instantiate the processor
