import org.apache.nifi.components.PropertyDescriptor
import org.apache.nifi.controller.ControllerService
import org.apache.nifi.processor.AbstractProcessor
import org.apache.nifi.processor.ProcessContext
import org.apache.nifi.processor.ProcessSession
import org.apache.nifi.processor.Relationship
import org.apache.nifi.processor.util.StandardValidators
import org.apache.nifi.flowfile.FlowFile
import groovy.json.JsonSlurper

class ScriptedProcessor extends AbstractProcessor {

    // Define properties for the processor
    static final PropertyDescriptor FRAGMENT_PATH = new PropertyDescriptor.Builder()
            .name("Fragment Path")
            .description("The JSON path to extract fragment attributes (dot notation)")
            .required(true)
            .addValidator(StandardValidators.NON_EMPTY_VALIDATOR)
            .build()

    static final Relationship REL_SUCCESS = new Relationship.Builder()
            .name("success")
            .description("Successfully processed flow files")
            .build()

    static final Relationship REL_FAILURE = new Relationship.Builder()
            .name("failure")
            .description("Failed to process flow files")
            .build()

    @Override
    List<PropertyDescriptor> getSupportedPropertyDescriptors() {
        return [FRAGMENT_PATH]
    }

    @Override
    Set<Relationship> getRelationships() {
        return [REL_SUCCESS, REL_FAILURE] as Set
    }

    @Override
    void onTrigger(final ProcessContext context, final ProcessSession session) {
        FlowFile flowFile = session.get()
        if (!flowFile) {
            return
        }

        // Read the configured fragment path
        String fragmentPath = context.getProperty(FRAGMENT_PATH).evaluateAttributeExpressions(flowFile).getValue()

        // Read the flow file content
        String jsonContent = new String(session.read(flowFile).bytes, "UTF-8")

        // Parse the JSON content
        def jsonSlurper = new JsonSlurper()
        def jsonData
        try {
            jsonData = jsonSlurper.parseText(jsonContent)
        } catch (Exception e) {
            getLogger().error("Failed to parse JSON: ${e.message}", e)
            session.transfer(flowFile, REL_FAILURE)
            return
        }

        // Traverse the JSON based on the fragment path
        def fragment
        try {
            fragment = fragmentPath.split("\\.").inject(jsonData) { current, key ->
                current?.get(key)
            }
        } catch (Exception e) {
            getLogger().error("Invalid fragment path: ${e.message}", e)
            session.transfer(flowFile, REL_FAILURE)
            return
        }

        if (fragment) {
            // Add attributes from the fragment
            flowFile = session.putAttribute(flowFile, "fragment.index", fragment?.index?.toString() ?: "")
            flowFile = session.putAttribute(flowFile, "fragment.count", fragment?.count?.toString() ?: "")
            flowFile = session.putAttribute(flowFile, "fragment.identifier", fragment?.identifier ?: "")
        } else {
            getLogger().warn("Fragment not found for path: ${fragmentPath}")
            session.transfer(flowFile, REL_FAILURE)
            return
        }

        // Transfer the updated flow file to success relationship
        session.transfer(flowFile, REL_SUCCESS)
    }
}

// Instantiate the processor
processor = new ScriptedProcessor()

