import org.apache.nifi.flowfile.FlowFile
import org.apache.nifi.processor.util.StandardValidators
import org.apache.nifi.processor.Relationship

import groovy.json.JsonSlurper

class AttributeInjectorProcessor implements Processor {

    static final Relationship REL_SUCCESS = new Relationship.Builder()
        .name("success")
        .description("FlowFiles that were successfully processed")
        .build()

    static final Relationship REL_FAILURE = new Relationship.Builder()
        .name("failure")
        .description("FlowFiles that failed to be processed")
        .build()

    private ComponentLog log

    @Override
    void initialize(ProcessorInitializationContext context) {
        log = context.getLogger()
    }

    @Override
    Set<Relationship> getRelationships() {
        return [REL_SUCCESS, REL_FAILURE] as Set
    }

    @Override
    void onTrigger(ProcessContext context, ProcessSessionFactory sessionFactory) throws ProcessException {
        ProcessSession session = sessionFactory.createSession()
        FlowFile flowFile = session.get()
        if (!flowFile) return

        try {
            // Read the content of the FlowFile
            def attributesMap = [:]
            flowFile = session.write(flowFile, new StreamCallback() {
                @Override
                void process(InputStream inputStream, OutputStream outputStream) throws IOException {
                    // Read the input content
                    String inputContent = inputStream.text
                    // Parse the JSON dictionary
                    def jsonSlurper = new JsonSlurper()
                    def jsonObject = jsonSlurper.parseText(inputContent)

                    // Extract and flatten attributes from 'request.nifi_attributes'
                    if (jsonObject.request?.nifi_attributes) {
                        attributesMap.putAll(flatten(jsonObject.request.nifi_attributes))
                    }

                    // Write the original content back to the flowFile
                    outputStream.write(inputContent.bytes)
                }
            })

            // Set attributes on the FlowFile outside of the StreamCallback
            attributesMap.each { key, value ->
                flowFile = session.putAttribute(flowFile, key, value.toString())
            }

            session.transfer(flowFile, REL_SUCCESS)
            session.commit()
        } catch (Exception e) {
            log.error("Failed to process FlowFile", e)
            session.transfer(flowFile, REL_FAILURE)
            session.rollback()
            throw new ProcessException(e)
        }
    }

    // Utility function to flatten a nested dictionary
    private Map<String, Object> flatten(Map<String, Object> map, String prefix = '') {
        def result = [:]
        map.each { key, value ->
            def newKey = prefix ? "${prefix}.${key}" : key.toString()
            if (value instanceof Map) {
                result.putAll(flatten(value as Map<String, Object>, newKey))
            } else {
                result[newKey] = value
            }
        }
        return result
    }

    @Override
    Collection<ValidationResult> validate(ValidationContext context) {
        return Collections.emptyList()
    }

    @Override
    PropertyDescriptor getPropertyDescriptor(String name) {
        return null
    }

    @Override
    void onPropertyModified(PropertyDescriptor descriptor, String oldValue, String newValue) { }

    @Override
    List<PropertyDescriptor> getPropertyDescriptors() {
        return Collections.emptyList()
