import org.apache.nifi.components.PropertyDescriptor
import org.apache.nifi.components.ValidationContext
import org.apache.nifi.components.ValidationResult
import org.apache.nifi.expression.ExpressionLanguageScope
import org.apache.nifi.flowfile.FlowFile
import org.apache.nifi.processor.*
import org.apache.nifi.processor.exception.ProcessException
import org.apache.nifi.logging.ComponentLog
import groovy.json.JsonSlurper

class GroovyProcessor implements Processor {

    def REL_MATCHED = new Relationship.Builder().name("matched").description("FlowFiles that matched the criteria").build()
    def REL_UNMATCHED = new Relationship.Builder().name("unmatched").description("FlowFiles that did not match the criteria").build()
    def REL_FAILURE = new Relationship.Builder().name("failure").description("FlowFiles that failed to process").build()
    def ComponentLog log

    static final PropertyDescriptor LIST_VALUES = new PropertyDescriptor.Builder()
            .name("List Values")
            .description("JSON array of values to check against")
            .required(true)
            .addValidator(StandardValidators.NON_EMPTY_VALIDATOR)
            .expressionLanguageSupported(ExpressionLanguageScope.FLOWFILE_ATTRIBUTES)
            .build()

    static final PropertyDescriptor TARGET_VALUE = new PropertyDescriptor.Builder()
            .name("Target Value")
            .description("The value to check for in the list")
            .required(true)
            .addValidator(StandardValidators.NON_EMPTY_VALIDATOR)
            .expressionLanguageSupported(ExpressionLanguageScope.FLOWFILE_ATTRIBUTES)
            .build()

    @Override
    void initialize(ProcessorInitializationContext context) {
        log = context.getLogger()
    }

    @Override
    Set<Relationship> getRelationships() {
        return [REL_MATCHED, REL_UNMATCHED, REL_FAILURE] as Set
    }

    @Override
    List<PropertyDescriptor> getPropertyDescriptors() {
        return [LIST_VALUES, TARGET_VALUE]
    }

    @Override
    void onTrigger(ProcessContext context, ProcessSessionFactory sessionFactory) throws ProcessException {
        def session = sessionFactory.createSession()
        def flowFile = session.get()
        if (!flowFile) return

        try {
            // Get property values with expression language support
            def listValues = context.getProperty(LIST_VALUES).evaluateAttributeExpressions(flowFile).getValue()
            def targetValue = context.getProperty(TARGET_VALUE).evaluateAttributeExpressions(flowFile).getValue()

            // Log the retrieved values for debugging
            log.info("listValues: ${listValues}")
            log.info("targetValue: ${targetValue}")

            if (listValues == null || listValues.trim().isEmpty()) {
                session.transfer(flowFile, REL_UNMATCHED)
            }

            // Parse listValues as JSON
            def jsonSlurper = new JsonSlurper()
            def list = jsonSlurper.parseText(listValues)

            if (list == null || !(list instanceof List)) {
                throw new ProcessException("Parsed listValues is not a valid JSON array")
            }

            // Check if list contains targetValue
            def result = list.contains(targetValue)

            // Transfer to appropriate relationship
            if (result) {
                session.transfer(flowFile, REL_MATCHED)
            } else {
                session.transfer(flowFile, REL_UNMATCHED)
            }
            session.commit()
        } catch (Exception e) {
            // Log the error
            log.error("Failed to process FlowFile due to {}", [e.toString()])
            // On error, add error attribute and transfer to FAILURE relationship
            flowFile = session.putAttribute(flowFile, 'error', e.message)
            session.transfer(flowFile, REL_FAILURE)
            session.commit()
        }
    }

    @Override
    Collection<ValidationResult> validate(ValidationContext context) {
        return Collections.emptyList()
    }

    @Override
    PropertyDescriptor getPropertyDescriptor(String name) {
        return null
    }

    @Override
    void onPropertyModified(PropertyDescriptor descriptor, String oldValue, String newValue) { }

    @Override
    String getIdentifier() {
        return null
    }
}

